pragma solidity >=0.4.21 <0.6.0;
pragma experimental ABIEncoderV2;

import './DDAI.sol';
import '../interfaces/IMakerFeed.sol';

contract DDAIGSNBouncer is DDAI  {

    IMakerFeed public priceFeed;

    constructor(
        address _moneyMarket,
        address _token,
        string memory _name,
        string memory _symbol,
        address[] memory _operators,
        address _priceFeed
    )
    public
    DDAI(_moneyMarket, _token, _name, _symbol, _operators) {
        priceFeed = IMakerFeed(_priceFeed);
    }

    // GSN FUNCTIONALITY should be in a seperate file
    function acceptRelayedCall(
        address _relay,
        address _from,
        bytes calldata _encodedFunction,
        uint256 _transactionFee,
        uint256 _gasPrice,
        uint256 _gasLimit,
        uint256 _nonce,
        bytes calldata _approvalData,
        uint256 _maxPossibleCharge
    ) external view returns (uint256, bytes memory) {

        if(_balanceOf(_from) < _maxPossibleCharge) {
            return(1, "DDAI.acceptRelayedCall: NOT_ENOUGH_DDAI_BALANCE");
        }
        // TODO implement check maxPossibleCharge is enough to buy the eth to pay for the tx plus some extra margin
        return(0, "");
    }

